import React from 'react'
import classes from "./Thumbnails.module.css"
import { Link } from 'react-router-dom'

const Thumbnails = ({ foods }) => {
  return (
   <ul className={classes.list}>
     {
        foods.map(food => 
            <li key={food.id}>
                <Link></Link>
            </li>
        )
     }
   </ul>
  )
}

export default Thumbnails
